data.comment:
The following are literal names and should not be translated: AndroidManifest.xml, //uses-sdk/@android:targetSdkVersion , API-{1}
{0} - The target SDK version number
{1} - The API version number

data.value:
Nie można odnaleźć pliku android.jar dla poziomu interfejsu API {0}. Oznacza to, że platforma zestawu Android SDK dla poziomu interfejsu API {0} nie jest zainstalowana. Oczekiwano, że będzie w „{1}”.
{2}
Aby uzyskać więcej informacji, zobacz https://aka.ms/xa5207.

Nie można pobrać artefaktu Maven „{0}:{1}”.
